import React from "react";
import PropTypes from 'prop-types'
import {Link} from "react-router-dom";

const headingStyle = {
    color: 'blue',
};

const Header = (props) => {
    return (
        <div class="post-f-t">
            <div class="collapse" id="collapsedContent">
                <div class="bg-dark p-4">
                    <ul class="navbar-nav mr-auto">
                        <li class="nav-item">
                            <Link to="/" class="nav-link">
                                Home
                            </Link>
                        </li>
                        <li class="nav-item">
                            <Link to="/athlete/add" class="nav-link">
                                Add athletes
                            </Link>
                        </li>
                        <li class="nav-item">
                            <Link to="/info" class="nav-link">
                                Information
                            </Link>
                        </li>
                    </ul>
                </div>
            </div>
            <nav class="navbar navbar-dark bg-dark">
                <div class="container">
                    <a href="/" class="navbar-brand">
                        Athletes
                    </a>
                </div>
                <button class="navbar-toggler" type="button" data-togle="collapse" data-target="#collapsedContent" aria-controls="navbarToggleExternalContent"
                    aria-expanded="false" aria-label="Toggle navigation">
                    <span class="navbar-toggler-icon"></span>
                </button>
            </nav>
        </div>
    );
};

// Header.defaultProps = {
//     turvataso: "pieni",
// }

// Header.propTypes = {
//     turvataso: PropTypes.string.isRequired,
// };

export default Header;
